import {BrowserRouter as Router, Route, Switch} from 'react-router-dom';
import DropboxUploader from './components/test';

function App() {
  return (
    <Router>
      <Routes>
          <Route path="/" component={DropboxUploader}/>
          <Route path="/uploader" component={DropboxUploader}/>
          </Routes>
    </Router>

    // <div>
    //   <DropboxUploader/>
    // </div>
  );
}

export default App;
